userReviews.positive:
We thought a number of factors:
- Location; downtown and walking distance to the Space Needle Tower and multiple museums. Walking distance to The Pike Market by the Waterfront;
- Modern facilities with pool and gym;
- Provision of all day seating in the eating area after the complimentary breakfast. This included use of the microwave;
- Business Centre was free and printing was free;
- Prompt response by the hotel staff on some issues we raise - excellent customer service.
